CREATE PROCEDURE `ppe`.`sp_reset_database`()
BEGIN
	DELETE FROM `ppe`.`notification`;
    DELETE FROM `ppe`.`wallet_customer`;
    DELETE FROM `ppe`.`privilege`;
    DELETE FROM `ppe`.`wallet_meter`;
    DELETE FROM `ppe`.`wallet`;
    DELETE FROM `ppe`.`meter_history`;
    DELETE FROM `ppe`.`meter`;
    DELETE FROM `ppe`.`contract_energy_type`;
    DELETE FROM `ppe`.`contract`;
    DELETE FROM `ppe`.`building`;
    DELETE FROM `ppe`.`provider_energy_type`;
    DELETE FROM `ppe`.`contract_type`;
    DELETE FROM `ppe`.`energy_type`;
    DELETE FROM `ppe`.`customer`;
    DELETE FROM `ppe`.`provider`;
    DELETE FROM `ppe`.`role`;
    DELETE FROM `ppe`.`language`;
#--------------CREATE DATA--------------------

    
    
 

 
 

 
 
 
   
   

        




        


    
END | 

delimiter ;

CREATE EVENT `ppe`.`ev_reset_database_event`
ON SCHEDULE EVERY 1 DAY
STARTS CURRENT_TIMESTAMP + INTERVAL 1 MINUTE
DO CALL `ppe`.`sp_reset_database`;


